" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 499px\">",
"   <div class=\"ttl\">",
"    Exon gene map of the human fibrinogen chains",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 479px; height: 434px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The reported mutations (or mutated initiation sites) are represented by triangles for patients with dysfibrinogenemias and by ovals for those with a- or hypo-fibrinogenemias. Scale for the total exon region and mutation localization is respected. Sites of important fibrinogen functions are identified.",
"    <div class=\"footnotes\">",
