var title_f42_15_43262="TIMI risk score predicts 30-day mortality after STEMI";
var content_f42_15_43262=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F78134&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F78134&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 536px\">",
"   <div class=\"ttl\">",
"    TIMI risk score predicts 30-day mortality after a myocardial infarction",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 516px; height: 451px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The TIMI risk score, which is a arithmatic summation of eight clinical variables, has a continuous association with 30-day mortality in patients with an ST elevation (STE) myocardial infarction who are eligible for fibrinolytic therapy.",
"    <div class=\"footnotes\">",
"     bpm: beats per minute; LBBB: left bundle branch block; HTN: hypertension.",
"    </div>",
"    <div class=\"reference\">",
"     Data from Morrow DA, Antman EM, Charlesworth A, et al. Circulation 2000; 102:2031.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
